import React from "react";

export default function NotFound ({image}) {
    return (
        <div>
            {image === "noimage" ?
            <img className = "img" src="https://i.ytimg.com/vi/mnMEfY1fORg/maxresdefault.jpg" alt="Link caido"/>
            : <img className="notfound" src="https://i.ytimg.com/vi/mnMEfY1fORg/maxresdefault.jpg" alt="Link caido"/>}
        </div>
    );
};
